import React, { useEffect, useState, useContext } from "react";
import axios from "axios";
import { AuthContext } from "../auth/AuthContext";
import { useNavigate } from "react-router-dom";
import { FaUserCircle } from "react-icons/fa";

const ManageInventory = () => {
    const { deptId, userRole } = useContext(AuthContext);
    const [inventory, setInventory] = useState([]);
    const [selectedItem, setSelectedItem] = useState(null);
    const [itemName, setItemName] = useState("");
    const [itemId, setId] = useState("");
    const [status, setStatus] = useState("");
    const [quantity, setQuantity] = useState("");
    const [room_id, setRoomId] = useState("");
    const [category, setCategory] = useState("");
    const [lastMaintenance, setLastMaintenance] = useState("");
    const navigate = useNavigate();  
    const [userName, setUserName] = useState(localStorage.getItem("userName") || "");

    useEffect(() => {
        fetchInventory();
    }, []);

    const fetchInventory = async () => {
        try {
            const token = localStorage.getItem("token");
            const response = await axios.get(`http://localhost:8800/api/inventory`, {
                headers: { Authorization: `Bearer ${token}` },
            });
            setInventory(response.data);
        } catch (error) {
            console.error("Error fetching inventory:", error);
        }
    };

    const resetForm = () => {
        setItemName("");
        setCategory("");
        setQuantity("");
        setRoomId("");
        setStatus("");
        setLastMaintenance("");
        setSelectedItem(null);
    };

    return (
        <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
            <div style={{ marginBottom: "20px" }}>
                <button onClick={() => navigate(-1)} style={{ marginRight: "10px" }}>← Back</button>
                <h1 style={{ display: "inline", fontSize: "24px" }}>Dharmshinh Desai University</h1>
            </div>

            <div style={{ display: "flex", alignItems: "center", marginBottom: "20px" }}>
                <FaUserCircle size={50} style={{ marginRight: "10px" }} />
                <p>{userName}</p>
            </div>

            <h2>Manage Inventory</h2>
            <table style={{ width: "80%", margin: "20px 0", borderCollapse: "collapse" }}>
                <thead>
                    <tr style={{ backgroundColor: "#f0f0f0" }}>
                        <th style={{ padding: "10px", border: "1px solid #ddd" }}>Item Name</th>
                        <th style={{ padding: "10px", border: "1px solid #ddd" }}>Category</th>
                        <th style={{ padding: "10px", border: "1px solid #ddd" }}>Quantity</th>
                        <th style={{ padding: "10px", border: "1px solid #ddd" }}>Location</th>
                        <th style={{ padding: "10px", border: "1px solid #ddd" }}>Status</th>
                        <th style={{ padding: "10px", border: "1px solid #ddd" }}>Last Maintenance</th>
                    </tr>
                </thead>
                <tbody>
                    {inventory.map((item) => (
                        <tr key={item.item_id}>
                            <td style={{ padding: "8px", border: "1px solid #ddd" }}>{item.i_name}</td>
                            <td style={{ padding: "8px", border: "1px solid #ddd" }}>{item.category}</td>
                            <td style={{ padding: "8px", border: "1px solid #ddd" }}>{item.quantity}</td>
                            <td style={{ padding: "8px", border: "1px solid #ddd" }}>{item.room_id}</td>
                            <td style={{ padding: "8px", border: "1px solid #ddd" }}>{item.status}</td>
                            <td style={{ padding: "8px", border: "1px solid #ddd" }}>{item.last_maintenance_date}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ManageInventory;
